import React from "react";

const Navbar = () => {
  const navbarStyle = {
    display: "flex",
    flexDirection: "column", // Set flex direction to column
    justifyContent: "center", // Align items vertically at the center
    alignItems: "center",
    padding: "10px",
    backgroundColor: "#f0f0f0",
  };

  const buttonsContainerStyle = {
    display: "flex",
    marginTop: "10px", // Add margin between heading and buttons
  };

  const navButtonStyle = {
    marginLeft: "10px",
    padding: "8px 16px",
    backgroundColor: "#3498db",
    color: "#fff",
    border: "none",
    // borderRadius: "4px",
    cursor: "pointer",
  };

  return (
    <div style={navbarStyle}>
      <h1>Monitoring</h1>
      <div style={buttonsContainerStyle}>
        {/* Button 1 */}
        <div style={navButtonStyle}>Button 1</div>

        {/* Button 2 */}
        <div style={navButtonStyle}>Button 2</div>
      </div>
    </div>
  );
};

export default Navbar;
